import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import ImageDetail from '../components/ImageDetail';

const data = [
    {
        title: 'forest',
        link: require('../../assets/forest.jpg')
    },
    {
        title: 'beach',
        link: require('../../assets/beach.jpg')
    },
    {
        title: 'mountain',
        link: require('../../assets/mountain.jpg')
    },
]

const ImageScreen = () => {
    return (
        <View>
            ImageScreen
        </View>
    );
}

const styles = () => StyleSheet.create({})

export default ImageScreen;
